@thefondleproject founder and breast cancer survivor @ginambelle with her love @charliebarkhorn 🖤

The Fondle Project is a movement focusing on the importance of intimately knowing our bodies. Breast cancer does not discriminate and is increasingly affecting younger and younger women. We aim to raise awareness around self exams as early detection saves lives. 

A breast cancer diagnosis and treatment can drastically affect a woman’s confidence and sense of self. The Fondle Project celebrates survivors living full and vibrant lives, sharing stories of beauty and hope. 

Please consider donating to one of the incredible organizations involved 🖤 

@bcrfcure 
@the_breasties 
@letsfcancer 

Thank you to the beautiful team that brought this shoot to life 🖤

